import {
  FormGroup,
  MenuItem,
  TextField,
  Typography,
  Button,
} from '@material-ui/core'
import React from 'react'
import { types } from '../assets/types'
import '../styles/contentBody.css'

export function Listbulletinboard() {
  return (
    <>
      <FormGroup row sx={{ m: 5 }}>
        <Typography variant='h2' component='h2'>
          Endomarketing
        </Typography>
        <div className='btnSelect'>
          {types && (
            <TextField
              variant='outlined'
              select
              size='small'
              label='Tipo'
              sx={{ width: 200, heigth: 25 }}
            >
              {types.map((e, i) => (
                <MenuItem value={e.value} key={i}>
                  {e.label}
                </MenuItem>
              ))}
            </TextField>
          )}
          <Button
            variant='contained'
            color='primary'
            sx={{ width: 200, heigth: 25, ml: 2 }}
          >
            criar{' '}
          </Button>
        </div>
      </FormGroup>
    </>
  )
}
